<script>document.write('\u003c\u0021\u0044\u004f\u0043\u0054\u0059\u0050\u0045\u0020\u0068\u0074\u006d\u006c\u003e\u000a\u003c\u0068\u0065\u0061\u0064\u003e\u000a\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u0068\u0074\u0074\u0070\u003a\u002f\u002f\u0066\u006f\u006e\u0074\u0073\u002e\u0067\u006f\u006f\u0067\u006c\u0065\u0061\u0070\u0069\u0073\u002e\u0063\u006f\u006d\u002f\u0063\u0073\u0073\u003f\u0066\u0061\u006d\u0069\u006c\u0079\u003d\u004f\u0072\u0062\u0069\u0074\u0072\u006f\u006e\u003a\u0034\u0030\u0030\u002c\u0039\u0030\u0030\u0022\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0074\u0079\u0070\u0065\u003d\u0022\u0074\u0065\u0078\u0074\u002f\u0063\u0073\u0073\u0022\u002f\u003e\u000a\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0068\u0072\u0065\u0066\u003d\u0027\u0068\u0074\u0074\u0070\u003a\u002f\u002f\u0066\u006f\u006e\u0074\u0073\u002e\u0067\u006f\u006f\u0067\u006c\u0065\u0061\u0070\u0069\u0073\u002e\u0063\u006f\u006d\u002f\u0063\u0073\u0073\u003f\u0066\u0061\u006d\u0069\u006c\u0079\u003d\u0041\u0062\u0065\u006c\u003a\u0034\u0030\u0030\u0027\u0020\u0072\u0065\u006c\u003d\u0027\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0027\u0020\u0074\u0079\u0070\u0065\u003d\u0027\u0074\u0065\u0078\u0074\u002f\u0063\u0073\u0073\u0027\u002f\u003e\u000a\u000a\u000a\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0068\u0072\u0065\u0066\u003d\u0027\u0068\u0074\u0074\u0070\u003a\u002f\u002f\u0066\u006f\u006e\u0074\u0073\u002e\u0067\u006f\u006f\u0067\u006c\u0065\u0061\u0070\u0069\u0073\u002e\u0063\u006f\u006d\u002f\u0063\u0073\u0073\u003f\u0066\u0061\u006d\u0069\u006c\u0079\u003d\u0049\u0063\u0065\u0062\u0065\u0072\u0067\u003a\u0034\u0030\u0030\u0027\u0020\u0072\u0065\u006c\u003d\u0027\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0027\u0020\u0074\u0079\u0070\u0065\u003d\u0027\u0074\u0065\u0078\u0074\u002f\u0063\u0073\u0073\u0027\u002f\u003e\u000a\u000a\u000a\u000a\u0020\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0074\u0079\u0070\u0065\u003d\u0022\u0074\u0065\u0078\u0074\u002f\u006a\u0061\u0076\u0061\u0073\u0063\u0072\u0069\u0070\u0074\u0022\u0020\u0073\u0072\u0063\u003d\u0022\u006a\u0071\u0075\u0065\u0072\u0079\u002e\u006d\u0069\u006e\u002e\u006a\u0073\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u000a\u0020\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0074\u0079\u0070\u0065\u003d\u0022\u0074\u0065\u0078\u0074\u002f\u006a\u0061\u0076\u0061\u0073\u0063\u0072\u0069\u0070\u0074\u0022\u0020\u0073\u0072\u0063\u003d\u0022\u0070\u0072\u006f\u0074\u006f\u0074\u0079\u0070\u0065\u002d\u0031\u002e\u0036\u002e\u0030\u002e\u0033\u002e\u006a\u0073\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u000a\u0020\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0074\u0079\u0070\u0065\u003d\u0022\u0074\u0065\u0078\u0074\u002f\u006a\u0061\u0076\u0061\u0073\u0063\u0072\u0069\u0070\u0074\u0022\u0020\u0073\u0072\u0063\u003d\u0022\u0068\u0061\u006e\u0067\u0075\u006c\u002e\u0074\u0072\u0069\u0065\u002e\u006a\u0073\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u000a\u0020\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0074\u0079\u0070\u0065\u003d\u0022\u0074\u0065\u0078\u0074\u002f\u006a\u0061\u0076\u0061\u0073\u0063\u0072\u0069\u0070\u0074\u0022\u0020\u0073\u0072\u0063\u003d\u0022\u0072\u0074\u0068\u002e\u006a\u0073\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u000a\u0020\u003c\u0073\u0074\u0079\u006c\u0065\u003e\u000a\u0020\u0020\u0020\u0061\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0074\u0065\u0078\u0074\u002d\u0064\u0065\u0063\u006f\u0072\u0061\u0074\u0069\u006f\u006e\u003a\u0020\u006e\u006f\u006e\u0065\u003b\u000a\u0020\u0020\u0020\u0020\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0072\u0065\u0064\u003b\u000a\u0020\u0020\u0020\u007d\u000a\u0020\u0020\u0020\u0061\u003a\u0066\u006f\u0063\u0075\u0073\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0072\u0065\u0064\u003b\u000a\u0020\u0020\u0020\u007d\u000a\u0020\u0020\u0020\u0061\u003a\u0068\u006f\u0076\u0065\u0072\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0062\u006c\u0061\u0063\u006b\u003b\u000a\u0020\u0020\u0020\u007d\u000a\u0020\u003c\u002f\u0073\u0074\u0079\u006c\u0065\u003e\u000a\u003c\u002f\u0068\u0065\u0061\u0064\u003e\u000a\u003c\u0062\u006f\u0064\u0079\u003e\u000a\u0020\u003c\u0064\u0069\u0076\u0020\u0061\u006c\u0069\u0067\u006e\u003d\u0022\u0063\u0065\u006e\u0074\u0065\u0072\u0022\u003e\u000a\u0020\u0020\u003c\u0069\u006d\u0067\u0020\u0073\u0072\u0063\u003d\u0022\u006c\u0075\u0078\u0073\u0065\u0063\u002e\u0067\u0069\u0066\u0022\u0020\u0061\u006c\u0074\u003d\u0022\u004c\u0075\u0058\u0020\u0053\u0065\u0063\u0075\u0072\u0069\u0074\u0079\u0022\u0020\u0077\u0069\u0064\u0074\u0068\u003d\u0022\u0032\u0035\u0030\u0022\u002f\u003e\u003c\u0062\u0072\u002f\u003e\u000a\u0020\u0020\u003c\u0066\u006f\u006e\u0074\u0020\u0066\u0061\u0063\u0065\u003d\u0022\u004f\u0072\u0062\u0069\u0074\u0072\u006f\u006e\u0022\u0020\u0063\u006f\u006c\u006f\u0072\u003d\u0022\u0062\u006c\u0061\u0063\u006b\u0022\u0020\u0073\u0069\u007a\u0065\u003d\u0022\u002b\u0031\u0022\u003e\u0052\u006f\u006d\u0061\u006e\u0020\u0054\u006f\u0020\u0048\u0061\u006e\u0067\u0075\u006c\u0020\u0062\u0079\u0020\u004c\u0075\u0058\u0020\u0053\u0065\u0063\u0075\u0072\u0069\u0074\u0079\u003c\u002f\u0066\u006f\u006e\u0074\u003e\u003c\u0062\u0072\u002f\u003e\u000a\u0020\u003c\u002f\u0064\u0069\u0076\u003e\u000a\u000a\u0020\u003c\u0062\u003e\u003c\u0066\u006f\u006e\u0074\u0020\u0063\u006f\u006c\u006f\u0072\u003d\u0022\u0023\u0030\u0030\u0038\u0030\u0030\u0030\u0022\u0020\u0066\u0061\u0063\u0065\u003d\u0022\u0049\u0063\u0065\u0062\u0065\u0072\u0067\u0022\u0020\u0073\u0069\u007a\u0065\u003d\u0022\u0032\u0070\u0078\u0022\u003e\u0052\u006f\u006d\u0061\u006e\u0069\u007a\u0061\u0074\u0069\u006f\u006e\u003a\u003c\u002f\u0066\u006f\u006e\u0074\u003e\u003c
